  "title": {
    "nb": "Antall nye arbeidsforhold 2017"
  },
  "description": {
    "nb": "Rapportering av lønns- og ansettelsesforhold til Skatteetaten, NAV og Statistisk sentralbyrå (SSB) er samlet i a-meldingen og skal sendes inn hver måned av alle som utbetaler lønn, pensjon og andre ytelser. A-meldingen inneholder opplysninger om lønn og ytelser, i tillegg til status på alle arbeidsforhold som lagres i Arbeidstaker- og arbeidsgiverregisteret (Aa-register). Lovgrunnlag for registrering av arbeidsforhold er a-opplysningsloven og folketrygdloven.Statistikken over antall nye arbeidsforhold viser antall arbeidsforhold som var nye en måned og som ikke var registrert måneden før. En person kan flere arbeidsforhold på samme tid, antall arbeidsforhold er derfor større enn antall sysselsatte. Data er fordelt på arbeidssted (kommune), næring , sektor og yrke. Data fra Aa-register er begrenset til kun å inneholde arbeidsforhold med mer en 1 times arbeid per uke (målt i måneden etter oppstart), kun data fra ny A-ordning, kun data for Norge og ikke permisjoner. Statistikk med antall nye arbeidsforhold under 4 er maskert med *. Data kan kobles med andre datasett fra NAV som inneholder yrke og med nasjonale kodestandarder for næringsgruppering (NACE) og yrkeskoder (STYRK)."
  },
  "descriptionFormatted": {
    "nb": "\u003cp\u003eRapportering av lønns- og ansettelsesforhold til Skatteetaten, NAV og Statistisk sentralbyrå (SSB) er samlet i\u003cstrong\u003e \u003ca href\u003d\"https://altinn.no/a-ordningen/\" rel\u003d\"nofollow\"\u003ea-meldingen\u003c/a\u003e\u003c/strong\u003e og skal sendes inn hver måned av alle som utbetaler lønn, pensjon og andre ytelser. A-meldingen inneholder opplysninger om lønn og ytelser, i tillegg til status på alle arbeidsforhold som lagres i \u003cstrong\u003eArbeidstaker- og arbeidsgiverregisteret\u003c/strong\u003e (Aa-register). Lovgrunnlag for registrering av arbeidsforhold er \u003ca href\u003d\"https://lovdata.no/dokument/NL/lov/2012-06-22-43\" rel\u003d\"nofollow\"\u003ea-opplysningsloven\u003c/a\u003e og \u003ca href\u003d\"https://lovdata.no/lov/1997-02-28-19/§25-1\" rel\u003d\"nofollow\"\u003efolketrygdloven\u003c/a\u003e.\u003c/p\u003e\u003cp\u003eStatistikken over \u003cstrong\u003eantall nye arbeidsforhold\u003c/strong\u003e viser antall arbeidsforhold som var nye en måned og som ikke var registrert måneden før. En person kan flere arbeidsforhold på samme tid, antall arbeidsforhold er derfor større enn antall sysselsatte. Data er fordelt på arbeidssted (kommune), næring , sektor og yrke. Data fra Aa-register er begrenset til kun å inneholde arbeidsforhold med mer en 1 times arbeid per uke (målt i måneden etter oppstart), kun data fra ny A-ordning, kun data for Norge og ikke permisjoner. Statistikk med antall nye arbeidsforhold under 4 er maskert med *. \u003c/p\u003e\u003cp\u003eData kan kobles med andre datasett fra NAV som inneholder yrke og med nasjonale kodestandarder for \u003ca href\u003d\"https://data.norge.no/data/registerenheten-i-br%C3%B8nn%C3%B8ysund/n%C3%A6ringskoder-i-enhetsregisteret\" rel\u003d\"nofollow\"\u003enæringsgruppering (NACE)\u003c/a\u003e og \u003ca href\u003d\"http://www.ssb.no/klass/klassifikasjoner/7\" rel\u003d\"nofollow\"\u003eyrkeskoder (STYRK)\u003c/a\u003e.\u003c/p\u003e"
