  "title": {
    "nb": "Statistikk - antall arbeidssøkere etter yrke og år"
  },
  "description": {
    "nb": "NAV publiserer offisiell statistikk på nav.no om antall arbeidsledige og arbeidssøkere. Dette datasett inneholder statistikk om arbeidssøkere fordelt på yrkesbakgrunn, med mer detaljerte yrkesopplysninger enn det som er publisert på nav.no. NAV benytter den internasjonale standarden for yrkesklassifisering, International Standard Classification of Occupations (ISCO) som ILO har utarbeidet. For klassifisering av yrker benyttes ISCO-08 (før januar 2012 ISCO-88 og før mai 2001 ISCO-58). Statistikken publiserer med yrkeskoder (4- siffer) inkludert NAV grupperinger for statistikk (grov- og fingruppering) og yrkesbetegnelser (6-siffer) under hver yrkeskode. I datasett er alle forekomster av yrkesbetegnelser satt sammen på samme rad. Skilletegn mellom yrkesbetegnelser i denne variabel er komma.Arbeidssøkere er betegnelsen på summen av helt ledige, delvis ledige, arbeidssøkere på tiltak og andre arbeidssøkere. Arbeidssøkere er personer som søker arbeid ved NAV og som er tilgjengelige for det arbeidet som søkes. Hovedregelen er at man anses som arbeidssøker hos NAV hvis man har meldt seg eller fornyet meldingen i løpet av de to siste ukene. Se Om statistikken - arbeidssøkere for ytterligere forklaringer.Datasett kan via SSB kodekatalog STYRK-kode kobles til flere statistikkgrupperinger for yrke. NAV benytter ISCO/STYRK også for annen statistikk og andre datasett, slik data kan kobles basert på yrkeskoder.Vasking av data: celler med under 4 personer er markert med stjerne for antall personer og tilhørende yrkesbetegnelse. I tillegg er enkelt yrkesbetegnelser som identifiserer svært små yrker også byttet med stjerne. "
  },
  "descriptionFormatted": {
    "nb": "\u003cp\u003e\u003cstrong\u003eNAV \u003c/strong\u003epubliserer \u003ca href\u003d\"https://www.nav.no/no/NAV+og+samfunn/Statistikk/Arbeidssokere+og+stillinger+-+statistikk/Hovedtall+om+arbeidsmarkedet\" rel\u003d\"nofollow\"\u003eoffisiell statistikk på nav.no\u003c/a\u003e om antall \u003cstrong\u003earbeidsledige og arbeidssøkere. \u003c/strong\u003eDette datasett inneholder statistikk om \u003cstrong\u003earbeidssøkere \u003c/strong\u003efordelt på \u003cstrong\u003eyrkesbakgrunn\u003c/strong\u003e, med mer detaljerte yrkesopplysninger enn det som er publisert på nav.no. NAV benytter den internasjonale standarden for yrkesklassifisering, International Standard Classification of Occupations (ISCO) som ILO har utarbeidet. For klassifisering av yrker benyttes ISCO-08 (før januar 2012 ISCO-88 og før mai 2001 ISCO-58). Statistikken publiserer med yrkeskoder (4- siffer) inkludert NAV grupperinger for statistikk (grov- og fingruppering) og yrkesbetegnelser (6-siffer) under hver yrkeskode. I datasett er alle forekomster av yrkesbetegnelser satt sammen på samme rad. Skilletegn mellom yrkesbetegnelser i denne variabel er komma.\u003c/p\u003e\u003cp\u003e\u003cstrong\u003eArbeidssøkere\u003c/strong\u003e er betegnelsen på summen av helt ledige, delvis ledige, arbeidssøkere på tiltak og andre arbeidssøkere. Arbeidssøkere er personer som søker arbeid ved NAV og som er tilgjengelige for det arbeidet som søkes. Hovedregelen er at man anses som arbeidssøker hos NAV hvis man har meldt seg eller fornyet meldingen i løpet av de to siste ukene. Se \u003ca href\u003d\"https://www.nav.no/1073745818/om-statistikken-arbeidss%C3%B8kere?kap\u003d1\" rel\u003d\"nofollow\"\u003eOm statistikken - arbeidssøkere\u003c/a\u003e for ytterligere forklaringer.\u003c/p\u003e\u003cp\u003eDatasett kan via SSB kodekatalog \u003ca href\u003d\"http://www.ssb.no/klass/klassifikasjoner/7/versjoner\" rel\u003d\"nofollow\"\u003eSTYRK-kode \u003c/a\u003ekobles til flere statistikkgrupperinger for yrke. NAV benytter ISCO/STYRK også for annen statistikk og andre datasett, slik data kan kobles basert på yrkeskoder.\u003c/p\u003e\u003cp\u003eVasking av data: celler med under 4 personer er markert med stjerne for antall personer og tilhørende yrkesbetegnelse. I tillegg er enkelt yrkesbetegnelser som identifiserer svært små yrker også byttet med stjerne.\u003c/p\u003e\u003cp\u003e \u003c/p\u003e\u003cp\u003e \u003c/p\u003e"
