  "title": {
    "nb": "NAVs bedriftsundersøkelse - etterspørsel etter arbeidskraft per næring"
  },
  "description": {
    "nb": "NAVs bedriftsundersøkelse ser på hvilke forventninger bedriftene har i forhold til sysselsettingsutviklingen det kommende året, om bedriftene har mislyktes i å rekruttere arbeidskraft de siste tre månedene og om dette skyldes for få kvalifiserte søkere på stillingene. På bakgrunn av disse svarene estimeres mangel på arbeidskraft for landet som helhet, for ulike regioner, samt enkeltnæringer og for ulike yrker. Undersøkelsen er årlig. Rapport i pdf- og xls-format publiseres på nav.no sine analysesider under Bedriftsundersøkelsen. Data presenteres i tre datasett for estimert mangel for yrke, næring og fylke. Dette datasettet inneholder estimert mangel på arbeidskraft i antall personer etter næring"
  },
  "descriptionFormatted": {
    "nb": "\u003cp\u003e\u003cstrong\u003eNAVs bedriftsundersøkelse\u003c/strong\u003e ser på hvilke forventninger bedriftene har i forhold til sysselsettingsutviklingen det kommende året, om bedriftene har mislyktes i å rekruttere arbeidskraft de siste tre månedene og om dette skyldes for få kvalifiserte søkere på stillingene. På bakgrunn av disse svarene estimeres mangel på arbeidskraft for landet som helhet, for ulike regioner, samt enkeltnæringer og for ulike yrker. Undersøkelsen er årlig. Rapport i pdf- og xls-format publiseres på nav.no sine analysesider under \u003ca href\u003d\"https://www.nav.no/no/NAV+og+samfunn/Kunnskap/Analyser+fra+NAV/Arbeid+og+velferd/Arbeid+og+velferd/bedriftsunders%C3%B8kelsen\" rel\u003d\"nofollow\"\u003eBedriftsundersøkelsen\u003c/a\u003e. Data presenteres i tre datasett for estimert mangel for yrke, næring og fylke. \u003c/p\u003e\u003cp\u003eDette datasettet inneholder estimert mangel på arbeidskraft i antall personer etter næring\u003c/p\u003e"
