  "title": {
    "nb": "Arbeidstilsynets statistikk over arbeidsskadedødsfall fordelt på måned"
  },
  "description": {
    "nb": "Her finner du et åpent datasett med Arbeidstilsynets statistikk over arbeidsskadedødsfall per år for siste hele femårsperiode. Arbeidsmiljøloven § 5-2 pålegger arbeidsgivere å varsle Arbeidstilsynet om alvorlige arbeidsrelaterte personskader på egne ansatte. Med arbeidsskadedødsfall menes en arbeidsskade som fører til at den skadde arbeidstakeren dør innen ett år etter at ulykken skjedde. Arbeidstilsynet fører statistikk over arbeidsskadedødsfall som inntreffer innen Arbeidstilsynets forvaltningsområde som er begrenset til det landbaserte arbeidslivet i Norge. Arbeidsskadedødsfall innen luftfart, sjøfart, fiske og fangst, petroleumsvirksomhet på norsk sokkel og oppføring og drift av landbaserte petroleumsanlegg, følges opp av andre tilsynsmyndigheter. Arbeidsskadedødsfall i disse næringene inngår derfor ikke i denne statistikken. Arbeidsskadedødsfall i militære yrker inngår, med unntak av dødsfall i krigssituasjoner. For mer informasjon om datasettet les her. Det åpne datasettet består av: Årstall (Ar), Månedsnavn (Maned), Antall arbeidsskadedødsfall (Antall) "
  },
  "descriptionFormatted": {
    "nb": "\u003cp\u003eHer finner du et åpent datasett med Arbeidstilsynets statistikk over arbeidsskadedødsfall per år for siste hele femårsperiode. \u003c/p\u003e\u003cp\u003e\u003ca href\u003d\"https://www.arbeidstilsynet.no/regelverk/lover/arbeidsmiljoloven/5/5-2/\" rel\u003d\"nofollow\"\u003eArbeidsmiljøloven § 5-2\u003c/a\u003e pålegger arbeidsgivere å varsle Arbeidstilsynet om alvorlige arbeidsrelaterte personskader på egne ansatte. Med arbeidsskadedødsfall menes en arbeidsskade som fører til at den skadde arbeidstakeren dør innen ett år etter at ulykken skjedde. \u003c/p\u003e\u003cp\u003eArbeidstilsynet fører statistikk over arbeidsskadedødsfall som inntreffer innen Arbeidstilsynets forvaltningsområde som er begrenset til det landbaserte arbeidslivet i Norge. Arbeidsskadedødsfall innen luftfart, sjøfart, fiske og fangst, petroleumsvirksomhet på norsk sokkel og oppføring og drift av landbaserte petroleumsanlegg, følges opp av andre tilsynsmyndigheter. Arbeidsskadedødsfall i disse næringene inngår derfor ikke i denne statistikken. Arbeidsskadedødsfall i militære yrker inngår, med unntak av dødsfall i krigssituasjoner. \u003c/p\u003e\u003cp\u003eFor mer informasjon om datasettet les \u003ca href\u003d\"https://www.arbeidstilsynet.no/om-oss/statistikk/arbeidsskadedodsfall/\" rel\u003d\"nofollow\"\u003eher\u003c/a\u003e. \u003c/p\u003e\u003cp\u003eDet åpne datasettet består av: Årstall (Ar), Månedsnavn (Maned), Antall arbeidsskadedødsfall (Antall) \u003c/p\u003e"
